import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MainPage from './MainPage';
import EnterPage from './EnterPage';
import LoginPage from './LoginPage';
import RegisterPage from './RegisterPage';
import ProfilePage from './ProfilePage';
import DriverMapPage from './DriverMapPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<MainPage />}>
          <Route index element={<EnterPage />} />  // Зробіть EnterPage стартовою сторінкою
          <Route path="login" element={<LoginPage />} />
          <Route path="register" element={<RegisterPage />} />
          <Route path="profile" element={<ProfilePage />} />
          <Route path="map" element={<DriverMapPage />} />
          <Route path="*" element={<EnterPage />} />  // Для будь-якого неопрацьованого маршруту
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
